import './App.css';

function App() {
  return (
    <div className="App">
      <p>Hello World!</p>
      <div>
        <form onSubmit={this.handleSubmit}>
          <input type="file" accept="video/*" id="upload" />
          <button id="start">Start</button>
        </form>
      </div>
    </div>
  );
}

export default App;
